import './GreatOperationButton.css'

export default function GreatOperationButton({getButton}){
    return(
        <div className="Button">
        <button className=""  onClick={getButton} id="+">+</button>
        <button className=""  onClick={getButton} id="-">-</button>
        <button className=""  onClick={getButton} id="/">/</button>
        <button className=""  onClick={getButton} id="*">*</button>
        <button className=""  onClick={getButton} id=".">.</button>
        <button className=""  onClick={getButton} id="C">C</button>
        </div>
    )
}
